import React from 'react'
import "./styles.css"
import imagem from "../assets/WhatsApp Image 2020-05-29 at 17.22.47.jpeg"

export default function CatPosts(){
    const vetorCats = [{jogos:{image:imagem,title:'THE GOD OF HIGH SCHOOL'}},
                        {animes:{image:imagem,title:'THE GOD OF HIGH SCHOOL'}},
                        {filmes:{image:imagem,title:'THE GOD OF HIGH SCHOOL'}}]

    return(
        <div className="container">
            {vetorCats.map((cat,key)=>(
                <div className="cats">
                    <img className="image" src={key == 0 ? vetorCats[key].jogos.image :
                                                key == 1 ? vetorCats[key].animes.image :
                                                vetorCats[key].filmes.image}/>
                    <div className="title"><h3>{key == 0 ? vetorCats[key].jogos.title :
                                                key == 1 ? vetorCats[key].animes.title :
                                                vetorCats[key].filmes.title}</h3></div>
                </div>
            ))}
        </div>
    )
}
